import React from "react";
import { YMaps, Map } from "react-yandex-maps";

class Contacts extends React.Component {
    render() {
        const mapSettings = {
            center: [47.629989, 43.146086],
            zoom: 5
        }
        return (
            <section>

                <YMaps>
                    <Map defaultState={mapSettings} width='1710px' />
                </YMaps>
            </section>
        )
    }
}

export default Contacts;
